func TestBlockConstraintsCounts(t *testing.T) {
	var blockCircuit BlockConstraints
	blockCircuit.TxsCount = 1
	gasAssetIds := []int64{0, 1}
	gasAccountIndex := int64(1)
	blockCircuit.Txs = make([]TxConstraints, blockCircuit.TxsCount)
	for i := 0; i < blockCircuit.TxsCount; i++ {
		blockCircuit.Txs[i] = GetZeroTxConstraint()
	}
	blockCircuit.GasAssetIds = gasAssetIds
	blockCircuit.GasAccountIndex = gasAccountIndex
	blockCircuit.Gas = GetZeroGasConstraints(gasAssetIds)
	blockCircuit.GKRs.AllocateGKRCircuit(11)

	r1cs, err := frontend.Compile(ecc.BN254.ScalarField(), r1cs.NewBuilder, &blockCircuit, frontend.IgnoreUnconstrainedInputs())
	if err != nil {
		fmt.Println("error occured ", err)
	}
	fmt.Println("block circuit constraints number is ", r1cs.GetNbConstraints())
}

func PrepareBlockConstraint() (constraint.ConstraintSystem, error) {
	var blockConstraints BlockConstraints
	blockConstraints.TxsCount = 1
	blockConstraints.Txs = make([]TxConstraints, blockConstraints.TxsCount)
	for i := 0; i < blockConstraints.TxsCount; i++ {
		blockConstraints.Txs[i] = GetZeroTxConstraint()
	}
	gasAssetIds := []int64{0, 1}
	gasAccountIndex := int64(1)
	blockConstraints.GasAssetIds = gasAssetIds
	blockConstraints.GasAccountIndex = gasAccountIndex
	blockConstraints.Gas = GetZeroGasConstraints(gasAssetIds)
	bn := 11
	blockConstraints.GKRs.AllocateGKRCircuit(bn)
	oR1cs, err := frontend.Compile(ecc.BN254.ScalarField(), r1cs.NewBuilder, &blockConstraints, frontend.IgnoreUnconstrainedInputs(), frontend.WithGKRBN(bn))
	return oR1cs, err
}

func IsSolved(oR1cs constraint.ConstraintSystem, witnessJson string) error {
	var cryptoBlock *Block
	err := json.Unmarshal([]byte(witnessJson), &cryptoBlock)
	if err != nil {
		return err
	}
	bn := 11
	blockWitness, err := SetBlockWitness(cryptoBlock, bn)
	if err != nil {
		return err
	}
	witness, err := frontend.NewWitness(&blockWitness, ecc.BN254.ScalarField())
	err = oR1cs.IsSolved(witness, backend.WithHints(types.PubDataToBytes))
	if err != nil {
		return err
	}
	return nil
}

